      function AFormula return Number is
begin
  if((:T_REALISER+:T_REESTIMER)<>0)THEN
  	return (:T_REALISER/(:T_REALISER+:T_REESTIMER))*100;
  else
  	return 0;
  end if;	
end;

      function CFormula return Number is
begin
   if((:TOT_T_REALISER)<>0)then
  	return ((:T_REALISER/:TOT_T_REALISER)*100);
  else
  	return 0;
  end if;	
end;

